import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Productos from "./components/Productos";
import AgregarProductos from "./components/AgregarProducto";
import EditarProductos from "./components/EditarProductos";
import menu from "./components/menu";

function App() {
  return (
    <div className="App">
      <h1>CRUD para agregar un producto</h1>
      <menu />
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Productos />} exact></Route>
          <Route path="/agregarProducto" element={<AgregarProductos />} exact>
            {" "}
          </Route>
          <Route path="/editarProducto" element={<EditarProductos />} exact>
            {" "}
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
